import React from "react";

export default function Login({ isOpen, children, closeLogin }) {
  if (!isOpen) return null;

  return (
    <div className="overlay">
      <div className="overlay-content usertxt flex-col gap-y-4">
        <button className="btn btn-sm loginbtnpos" onClick={closeLogin}>
          X
        </button>
        {children}
        <div className="input-container gap-x-4">
          USERNAME:
          <input className="input input-inside" id="user" name="user"></input>
        </div>
        <div className="input-container gap-x-4">
          PASSWORD:
          <input className="input input-inside" id="pass" name="pass"></input>
        </div>
      </div>
    </div>
  );
}
